import React from 'react';
function Team(){
    return(
        <>
        <div>
            <h2>Contact Information</h2>
            <p>Do you find this tool useful? Find a bug? Have a feature request? Drop me a line and let me know!

                Harjot Singh Dhillon
                Jan Nayak Ch. Devilal Memorial College Of Engineering,
                Department of Computer Science
                Chaudhary Devilal University
                Sirsa(125055),Hayarana
                San Francisco, CA 94117-1080 USA

                galles (at) usfca.edu
            </p>
        </div>
        </>
    );
}
export default Team;
